let pathsindex = 0; 

let points = [];
let stateinit = false;
let step = 0;

function initanim() {  // function used to animate appearance of points 

    let t = step / 100;
    let t2 = (step - 1) / 100;
    let speed = t * t * (3 - 2 * t) - t2 * t2 * (3 - 2 * t2);  // bzier curve

    for (let i = 0; i < points.length; i++) {

        if (!points[i]['OneThatSpins']) {  // spinning points appear after init animation is over

            ctx.beginPath();
            ctx.arc(points[i]['InitialX'], points[i]['InitialY'], points[i]['initialSize'] / 1000, 0, 2 * Math.PI);
            ctx.fill();

            points[i]['InitialX'] += Math.sin(points[i]['angle']) * speed * points[i]['range'];
            points[i]['InitialY'] += Math.cos(points[i]['angle']) * speed * points[i]['range'];

            if (points[i]['FadeInDelay'] != 0) {

                points[i]['FadeInDelay'] -= 1;

            } else if (points[i]['size'] > points[i]['initialSize']) {

                points[i]['initialSize'] += points[i]['size'] / 20;  // fade in in 20 ticks

            }

        }

    }

}

let mouseX = null;
let mouseY = null;
let cursorPosition = null;
function getCursorPosition(canvas, event) { // code stolen from stackoverflow to track mouse position on canvas
    const rect = canvas.getBoundingClientRect();
    const x = event.clientX - rect.left;
    const y = event.clientY - rect.top;
    mouseX = x;
    mouseY = y;
}

canvas.addEventListener('mousemove', function (e) {
    getCursorPosition(canvas, e);
});

canvas.addEventListener('mouseleave', function (e) {
    mouseX = null;
    mouseY = null;
    cursorPosition = null;
});

////////////////////////////////////////////////

const MyWorker = new Worker("init.js");  // we use worker cuz js is single threaded and 50k iterations will cause stuttering 
const canvasWorker = canvas.cloneNode().transferControlToOffscreen(); // this is the only way to pass canvas to worker
MyWorker.postMessage({ canvas: canvasWorker }, [canvasWorker]);

MyWorker.postMessage([paths[pathsindex][0], paths[pathsindex][1]]);
pathsindex += 1;

MyWorker.onmessage = function (e) {
    points = e.data;
    stateinit = true;
    step = 0;
    rdytoreset = true;
}

////////////////////////////////////////////////

let range;
let angle;

let distX = null, distY = null;

let cursorSpeed = 10;
let speedX, speedY;

let cursorSize = 30;
let cursorToggle = false; 

let flagEmpty = false; // is canvas empty, true - empty, false - not
let reseted = false;  // to avoid spawning millions of settimeouts
let rdytoreset = false;  // to avoid triggering reset when points are not generated yet

function anim() {  // main loop

    flagEmpty = true;

    ctx.clearRect(0, 0, canvas.width, canvas.height);
    requestAnimationFrame(anim);

    if (mouseX != null && mouseY != null) {  // animating cursor

        if (cursorPosition == null) {

            cursorPosition = [mouseX, mouseY, 0, 0];

        } else {

            distX = mouseX - cursorPosition[0];
            distY = mouseY - cursorPosition[1];

            if (distX != 0 && distY != 0) {  // note that js gives shit when sin(0)

                range = Math.sqrt(distX * distX + distY * distY);
                cursorSpeed = range / 3;    // it makes our custom cursor movement smooth, also it may depend on canvas size idk

                if (range < 0.5) {   // stop cursor if too close

                    cursorPosition = [mouseX, mouseY, 0, 0];

                } else {

                    angle = Math.abs(Math.atan(distX / distY));  // for some reason negative angles dont work

                    speedX = Math.sin(angle) * cursorSpeed;
                    speedY = Math.cos(angle) * cursorSpeed;

                    if (distX < 0) {  // so i did this
                        speedX = -speedX;
                    }

                    if (distY < 0) { // and this
                        speedY = -speedY;
                    }

                    cursorPosition[2] = speedX;
                    cursorPosition[3] = speedY;

                }

            }

            ctx.beginPath();  // rendering custom cursor
            ctx.arc(cursorPosition[0], cursorPosition[1], cursorSize, 0, 2 * Math.PI);
            ctx.fill();

            cursorPosition[0] += cursorPosition[2];
            cursorPosition[1] += cursorPosition[3];

            if (cursorToggle) {  // cursor growing and shrinking
                cursorSize -= .1;
            } else {
                cursorSize += .1;
            }

            if (cursorSize >= 40) {
                cursorToggle = true;
            }

            if (cursorSize <= 30) {
                cursorToggle = false;
            }

        }

    }

    if (stateinit == true) {    // if init is active

        if (step <= 100) {

            initanim();
            step += 1;

        } else {  // one final tick to end init anim

            stateinit = false;
            step = 0;

            for (let i = 0; i < points.length; i++) {

                if (points[i]['OneThatSpins']) {

                    points[i]['InitialX'] = points[i]['X'];
                    points[i]['InitialY'] = points[i]['Y'];

                } else {

                    points[i]['range'] = 0;
                    points[i]['angle'] = 0;
                    points[i]['InitialX'] = 0;
                    points[i]['InitialY'] = 0;

                }

                ctx.beginPath();
                ctx.arc(points[i]['X'], points[i]['Y'], points[i]['size'] / 1000, 0, 2 * Math.PI);
                ctx.fill();

            }

        }

        return;  // if init isnt over we return and do nothing after this

    }

    if (mouseX != null && mouseY != null) { // tick with mouse over

        for (let i = 0; i < points.length; i++) {

            if (points[i]['IsActive']) {  // is active means point is sent flying already

                if (points[i]['size'] != 0) {

                    if (points[i]['FadeInDelay'] != 0) {
                        points[i]['FadeInDelay'] -= 1;
                    } else {
                        points[i]['size'] -= 50;
                    }

                    points[i]['X'] += points[i]['SpeedX'];
                    points[i]['Y'] += points[i]['SpeedY'];

                    points[i]['SpeedX'] /= 1.025;
                    points[i]['SpeedY'] /= 1.025;

                    ctx.beginPath();
                    ctx.arc(points[i]['X'], points[i]['Y'], points[i]['size'] / 1000, 0, 2 * Math.PI);
                    ctx.fill();

                }

            } else {

                flagEmpty = false;

                distX = cursorPosition[0] - points[i]['X'];
                distY = cursorPosition[1] - points[i]['Y'];

                range = Math.sqrt(distX * distX + distY * distY);

                if (range < cursorSpeed * 1.2 || range < 55) {    // cursor max size, may depend on canvas size

                    angle = Math.random() * 360 * Math.PI / 180;
                    points[i]['SpeedX'] = Math.sin(angle) * 5;
                    points[i]['SpeedY'] = Math.cos(angle) * 5;
                    points[i]['IsActive'] = true;

                    if (Math.random() > .9) {
                        points[i]['FadeInDelay'] = 50;
                    }

                } else {

                    if (points[i]['OneThatSpins']) {    // spinning points

                        if (points[i]['size'] > points[i]['initialSize']) {

                            points[i]['initialSize'] += points[i]['size'] / 50;  // fade in in n ticks

                        }

                        if (points[i]['angle'] * Math.PI / 180 >= 360) {  // i will make them to fade in

                            points[i]['angle'] = 0;

                        } else {

                            points[i]['angle'] += points[i]['SpinSpeed'];

                        }

                        points[i]['X'] = points[i]['InitialX'] + Math.cos(points[i]['angle']) * points[i]['range'];
                        points[i]['Y'] = points[i]['InitialY'] + Math.sin(points[i]['angle']) * points[i]['range'];

                        ctx.beginPath();
                        ctx.arc(points[i]['X'], points[i]['Y'], points[i]['initialSize'] / 1000, 0, 2 * Math.PI);
                        ctx.fill();

                    } else {

                        if (!points[i]['OneThatFades']) {

                            if (Math.random() > 0.99) {

                                points[i]['OneThatFades'] = true;
                                points[i]['FadingDirection'] = true;  // false - growing, true - shrinking
                                points[i]['initialSize'] = points[i]['size'];

                            }

                        }

                        if (points[i]['OneThatFades']) {

                            if (points[i]['FadingDirection']) {

                                if (points[i]['initialSize'] <= 0) {

                                    points[i]['initialSize'] = 0;
                                    points[i]['FadingDirection'] = false;

                                } else {
                                    points[i]['initialSize'] -= 50;
                                }

                            } else {

                                if (points[i]['initialSize'] >= points[i]['size']) {

                                    points[i]['initialSize'] = points[i]['size'];
                                    points[i]['FadingDirection'] = true;
                                    points[i]['OneThatFades'] = false;

                                } else {
                                    points[i]['initialSize'] += 50;
                                }

                            }

                            if (points[i]['initialSize'] < 0) {
                                points[i]['initialSize'] = 0;
                            }

                            ctx.beginPath();
                            ctx.arc(points[i]['X'], points[i]['Y'], points[i]['initialSize'] / 1000, 0, 2 * Math.PI);
                            ctx.fill();

                        } else {

                            ctx.beginPath();
                            ctx.arc(points[i]['X'], points[i]['Y'], points[i]['size'] / 1000, 0, 2 * Math.PI);
                            ctx.fill();

                        }

                    }

                }

            }

        }

    } else {  // no mouse

        for (let i = 0; i < points.length; i++) {

            if (points[i]['IsActive']) {

                if (points[i]['size'] != 0) {

                    if (points[i]['FadeInDelay'] != 0) {
                        points[i]['FadeInDelay'] -= 1;
                    } else {
                        points[i]['size'] -= 50;
                    }

                    points[i]['X'] += points[i]['SpeedX'];
                    points[i]['Y'] += points[i]['SpeedY'];

                    points[i]['SpeedX'] /= 1.025;
                    points[i]['SpeedY'] /= 1.025;

                    ctx.beginPath();
                    ctx.arc(points[i]['X'], points[i]['Y'], points[i]['size'] / 1000, 0, 2 * Math.PI);
                    ctx.fill();

                }

            } else {

                flagEmpty = false;

                if (points[i]['OneThatSpins']) {    // spinning points

                    if (points[i]['size'] > points[i]['initialSize']) {

                        points[i]['initialSize'] += points[i]['size'] / 50;  // fade in in n ticks

                    }

                    if (points[i]['angle'] * Math.PI / 180 >= 360) {  // i will make them to fade in

                        points[i]['angle'] = 0;

                    } else {

                        points[i]['angle'] += points[i]['SpinSpeed'];

                    }

                    points[i]['X'] = points[i]['InitialX'] + Math.cos(points[i]['angle']) * points[i]['range'];
                    points[i]['Y'] = points[i]['InitialY'] + Math.sin(points[i]['angle']) * points[i]['range'];

                    ctx.beginPath();
                    ctx.arc(points[i]['X'], points[i]['Y'], points[i]['initialSize'] / 1000, 0, 2 * Math.PI);
                    ctx.fill();

                } else {

                    if (!points[i]['OneThatFades']) {

                        if (Math.random() > 0.99) {

                            points[i]['OneThatFades'] = true;
                            points[i]['FadingDirection'] = true;  // false - growing, true - shrinking
                            points[i]['initialSize'] = points[i]['size'];

                        }

                    }

                    if (points[i]['OneThatFades']) {

                        if (points[i]['FadingDirection']) {

                            if (points[i]['initialSize'] <= 0) {

                                points[i]['initialSize'] = 0;
                                points[i]['FadingDirection'] = false;

                            } else {
                                points[i]['initialSize'] -= 50;
                            }

                        } else {

                            if (points[i]['initialSize'] >= points[i]['size']) {

                                points[i]['initialSize'] = points[i]['size'];
                                points[i]['FadingDirection'] = true;
                                points[i]['OneThatFades'] = false;

                            } else {
                                points[i]['initialSize'] += 50;
                            }

                        }

                        if (points[i]['initialSize'] < 0) {
                            points[i]['initialSize'] = 0;
                        }

                        ctx.beginPath();
                        ctx.arc(points[i]['X'], points[i]['Y'], points[i]['initialSize'] / 1000, 0, 2 * Math.PI);
                        ctx.fill();

                    } else {

                        ctx.beginPath();
                        ctx.arc(points[i]['X'], points[i]['Y'], points[i]['size'] / 1000, 0, 2 * Math.PI);
                        ctx.fill();

                    }

                }

            }

        }

    }

    if (flagEmpty && !reseted && rdytoreset) {

        reseted = true;

        setTimeout(() => {

            MyWorker.postMessage([paths[pathsindex][0], paths[pathsindex][1]]);

            if (pathsindex + 1 == paths.length) {
                pathsindex = 0;
            } else {
                pathsindex += 1;
            }

            reseted = false;
            rdytoreset = false;

        }, 2000);

    }

}

anim();
